function PegarValores(n){for(var i=[],r=n.length,t=0;t<r;)i.push(n[t].valores),t++;return i}function PegarTiposDespesas(n){for(var i=[],r=n.length,t=0;t<r;)i.push(n[t].tiposDespesas),t++;return i}function PegarMeses(n){for(var i=[],r=n.length,t=0;t<r;)i.push(n[t].nomeMeses[0]),t++;return i}function PegarCores(n){for(var t=[];n>0;){var i=Math.floor(Math.random()*255),r=Math.floor(Math.random()*255),u=Math.floor(Math.random()*255);t.push("rgb("+i+", "+r+","+u+")");n--}return t}